'use strict';

/**
* Image of sheep in a pastoral setting.
*
* @module @stdlib/datasets/img-march-pastoral
*
* @example
* var image = require( '@stdlib/datasets/img-march-pastoral' );
* var img = image();
* // returns <Buffer>
*/

// MODULES //

var IS_BROWSER = require( '@stdlib/assert/is-browser' );


// MAIN //

var image;
if ( IS_BROWSER ) {
	image = require( './browser.js' );
} else {
	image = require( './march_pastoral.js' );
}


// EXPORTS //

module.exports = image;
